          `,-1),NU=s(),jU=i("div",{class:"callout-list link-large"},[i("p",null,"The Australian Government, in consultation with the Australian Building Codes Office and the states and territories, undertake regulatory impact analysis on:"),s(),i("ul",null,[i("li",{class:"link-large"},"whether accessible car-parking ratios are adequate"),s(),i("li",{class:"link-large"},"where automatic doors are used, including their use in accessible toilet facilities."),s(),i("li",{class:"link-large"},"the adequacy of dimensions of openings and thoroughfares in the Premises Standards and the opportunity to align with the Disability Standards for Accessible Public Transport 2002 (Transport Standards).")]),s(),i("p",null,"This work will provide evidence for any future changes to the Premises Standards and the National Construction Code (NCC).")],-1),FU=Ct(' <div><h4 class="text-primary display-medium mb-3">What we heard</h4> <div class="pb-5"><p>People living with disability told us they find it easier to access premises that were built after the Premises Standards were introduced. This indicates that the Premises Standards are achieving their objectives.</p> <p>However, people living with disability also identified emerging issues and areas for improvement. These included:</p> <ul><li class="link-large">inconsistent requirements for signage and luminance contrast</li> <li class="link-large">a lack of information on emerging wayfinding solutions</li> <li class="link-large">a lack of accessible carparks and automatic doors</li></ul> <p>These issues need to be addressed to ensure the Premises Standards continue achieving their objectives.</p> <p>Building professionals told us they needed better guidance to help them comply with the Premises Standards. They were particularly concerned about how to apply the Premises Standards to significant works on older and heritage-listed buildings.</p> <p>Building professionals were also concerned about the inconsistencies among disability standards, state and territory requirements and the National Construction Code (NCC).</p> <p>Many businesses emphasised a need for practical guidance, such as check lists, to help them improve access for employees when negotiating commercial leases.</p> <p>Unfortunately this review could not address every issue raised by stakeholders. We will continue engaging with stakeholders to address other issues.</p></div> <div class="pb-5"><h4 class="text-primary display-medium mb-3">Opportunities for action</h4> <p>The opportunities for action align with these areas. If agreed by the government, these actions will ensure the Premises Standards continue meeting their objectives.</p> <h6 class="text-gray-600 heading-medium lead">Regulatory reform</h6> <p>People living with disability told us they find it easier to access premises that were built after the Premises Standards were introduced. This indicates that the Premises Standards are achieving their objectives.</p> <p>However, people living with disability also identified emerging issues and areas for improvement. These included:</p> <ul><li class="link-large">inconsistent requirements for signage and luminance contrast</li> <li class="link-large">a lack of information on emerging wayfinding solutions</li> <li class="link-large">a lack of accessible carparks and automatic doors</li></ul></div></div>',2),BU=s(),VU=s(),qU={class:"container-small text-gray-600 py-6"},UU={class:"pb-5"},WU=i("div",{class:"heading-extra-small-caps text-primary mb-4"},`
